Огромное развлекательное пространство:
- интерактивные выставки;
- захватывающие арт-объекты;
- перформансы с полным погружением;
- эффект-квесты и аллеи впечатлений;
- фотозоны-иллюзии;
- мастер-классы;
- шоу-площадки;
- игры, сюрпризы и подарки;
- лекторий, посвященный креативным индустриям;
- маркет локальных брендов.

Бери с собой чемодан, если планируешь принять участие во всех мастер-классах! Домой придется унести множество собственноручно созданных шедевров!

-атмосфера вечеринки с закусками, напитками и музыкой;
-крутая фотозона для обновления аватарок и фотоальбомов;
-игротека, ведь какие встречи с друзьями без настолок?
-арт-объект, посвященный дружбе, на который вы сможете внести свой отпечаток

А ровно в 19:00 всех гостей ждёт уникальный Митап, на котором вы познакомитесь друг с другом и с командой жатэ. Следи за группой и ждём тебя, друг!

Регистрация на День Друзей: https://forms.yandex.ru/u/66b1cd0573cee733d8cec848/

22 августа мы приглашаем всех на площадку возле молодежного центра «Старт», чтобы побольше узнать об этом празднике и поучаствовать в программе «Триколор страны родной»!

Что тебя ожидает? 🤔
💭 Выступления наших студий;
💭 Квиз для знатоков;
💭 Семейные конкурсы и творческий мастер-класс;
💭 Конкурс рисунков на асфальте;
💭 И конечно же сбор батареек, крышечек и необходимых вещей для животных

🎉Интерактивная площадка с крутыми конкурсами, играми, эстафетами и викториной «Наш дом - Ельцовка»;
🎉 Игровая площадка для малышей от 0 до 3-х лет;
🎉 Красочный аквагрим для кардинальной смены образа;
🎉 Настольные игры: вкусные шашки, загадки, лабиринты, башня;
🎉 Мастер-класс по созданию 3D открытки для тех, чьи руки готовы создавать красоту.

17 августа пройдет Мастер класс по акварельной живописи с арт-терапевтом + выставка работ "Кляксография ":

- при помощи акварельных красок создадим семейный рисунок в технике кляксография;
- раскроем свое воображение и увидим в кляксах художественные образы;
- снимем напряжение и раскроем творческий потенциал;
- разовьем навыки находить позитивные выходы из любой ситуации;

В этот вечер на сцене:

Евгений Малков — вокал, текст, музыка;
Сергей Алдошин — гитара, бэк-вокал, музыка;
Софья Зорина — виолончель;
Юрий Васильев — бас;
Алексей Белковский — гитара;
Филипп Васильев — флейта;
Александр Добровольский — барабаны.

🎫Билеты: https://vpobede.ru/shows/ilvingi-16-08-2024
Также спрашивайте в кассах кинотеатра «Победа»!

Что вас ждет?

1. Общие правила приготовления мяса;
2. Приготовление мяса в разных техниках: жарка, варка, тушение, запекание;
3. Работа с альтернативными отрубами;
4. Приготовление английского ростбифа;
5. Приготовление мясных соусов.

